INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (401, 24001, 24, 10046, 102301, "2030/12/17 14:59:59", 0.0, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00", 0.0, 0.0, 2, "アヤネ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (402, 24002, 24, 10046, 102301, "2030/12/17 14:59:59", 0.0, 2, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00", 2.21, 0.0, 1, "アヤネ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (403, 24003, 24, 10046, 102301, "2030/12/17 14:59:59", 0.0, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00", 0.0, 0.0, 2, "アヤネ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (701, 24004, 24, 10046, 192201, "2030/12/17 14:59:59", 0.0, 1, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", 1.99, 0.0, 2, "アサヒ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (702, 24005, 24, 10046, 192201, "2030/12/17 14:59:59", 0.0, 2, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00", 2.21, 0.0, 1, "アサヒ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (703, 24006, 24, 10046, 192201, "2030/12/17 14:59:59", 0.0, 1, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", 3.33, 0.0, 2, "アサヒ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (801, 24007, 24, 10046, 192301, "2030/12/17 14:59:59", 0.0, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00", 0.0, 0.0, 2, "部員３");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (802, 24008, 24, 10046, 192301, "2030/12/17 14:59:59", 0.0, 2, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00", 2.68, 0.0, 1, "部員３");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (803, 24009, 24, 10046, 192301, "2030/12/17 14:59:59", 0.0, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", 0.0, 0.0, 2, "部員３");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (501, 24010, 24, 10046, 192501, "2030/12/17 14:59:59", 0.0, 1, "やった！", "2020/07/31 12:00:00", 0.0, 0.0, 1, "");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (502, 24011, 24, 10046, 192501, "2030/12/17 14:59:59", 0.0, 1, "勝ったよ！", "2020/07/31 12:00:00", 0.0, 0.0, 1, "");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (503, 24012, 24, 10046, 192501, "2030/12/17 14:59:59", 0.0, 1, "いい調子！", "2020/07/31 12:00:00", 0.0, 0.0, 1, "");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (111, 24013, 24, 10046, 113501, "2030/12/17 14:59:59", 0.0, 2, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00", 5.33, 0.0, 6, "ミサト");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (112, 24014, 24, 10046, 113501, "2030/12/17 14:59:59", 0.0, 2, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00", 6.85, 0.0, 1, "ミサト");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113, 24015, 24, 10046, 113501, "2030/12/17 14:59:59", 0.0, 2, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00", 3.0, 0.0, 1, "ミサト");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (611, 24016, 24, 10046, 192401, "2030/12/17 14:59:59", 0.0, 2, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00", 6.11, 0.0, 1, "ダイチ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (612, 24017, 24, 10046, 192401, "2030/12/17 14:59:59", 0.0, 2, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00", 6.75, 0.0, 1, "ダイチ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (613, 24018, 24, 10046, 192401, "2030/12/17 14:59:59", 0.0, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00", 0.0, 0.0, 2, "ダイチ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (211, 24019, 24, 10046, 113401, "2030/12/17 14:59:59", 0.0, 1, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", 4.52, 0.0, 2, "ハツネ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (212, 24020, 24, 10046, 113401, "2030/12/17 14:59:59", 0.0, 1, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00", 3.89, 0.0, 2, "ハツネ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (213, 24021, 24, 10046, 113401, "2030/12/17 14:59:59", 0.0, 2, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00", 13.49, 0.0, 1, "ハツネ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (311, 24022, 24, 10046, 106501, "2030/12/17 14:59:59", 0.0, 2, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00", 3.17, 0.0, 1, "カヤ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (312, 24023, 24, 10046, 106501, "2030/12/17 14:59:59", 0.0, 2, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00", 4.42, 0.0, 1, "カヤ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (313, 24024, 24, 10046, 106501, "2030/12/17 14:59:59", 0.0, 1, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00", 2.89, 0.0, 6, "カヤ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (421, 24025, 24, 10046, 102301, "2030/12/17 14:59:59", 0.0, 3, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00", 3.71, 0.0, 4, "アヤネ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (721, 24026, 24, 10046, 192201, "2030/12/17 14:59:59", 0.0, 1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00", 5.1, 0.0, 2, "アサヒ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (821, 24027, 24, 10046, 192301, "2030/12/17 14:59:59", 0.0, 3, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00", 4.34, 0.0, 1, "部員３");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (521, 24028, 24, 10046, 192501, "2030/12/17 14:59:59", 0.0, 1, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00", 0.0, 0.0, 1, "");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (101, 24029, 24, 10046, 113501, "2030/12/17 14:59:59", -360.0, 2, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00", 5.62, 0.0, 1, "ミサト");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102, 24030, 24, 10046, 113501, "2030/12/17 14:59:59", -360.0, 2, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00", 9.58, 0.0, 1, "ミサト");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (103, 24031, 24, 10046, 113501, "2030/12/17 14:59:59", -360.0, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00", 0.0, 0.0, 2, "ミサト");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (104, 24032, 24, 10046, 113501, "2030/12/17 14:59:59", -360.0, 1, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00", 9.13, 0.0, 2, "ミサト");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (105, 24033, 24, 10046, 113501, "2030/12/17 14:59:59", -360.0, 2, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00", 8.27, 0.0, 1, "ミサト");
